  `fecha` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'fecha de la factura',
  `subtotal` float(10,2) NOT NULL,
  `iva` float(10,2) NOT NULL,
  `total` float(10,2) NOT NULL COMMENT 'monto total de la factura',
  `estatus_id` int(2) unsigned DEFAULT NULL COMMENT 'estatus de la factura',
  `comprobante` varchar(190) NOT NULL COMMENT 'archivo pdf o imagen del comprobante de la factura',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `user_id_reg` int(10) unsigned NOT NULL COMMENT 'id de usuario que registra la factura',
  PRIMARY KEY (`id`),
  KEY `cliente_id` (`cliente_id`),
  KEY `direccion_id` (`direccion_id`),
  KEY `empresa_id` (`empresa_id`),
  KEY `metodopago_id` (`metodopago_id`),
  KEY `condicionpago_id` (`condicionpago_id`),
  KEY `estatus_id` (`estatus_id`),
  KEY `user_id_reg` (`user_id_reg`),
  CONSTRAINT `facturacion_ibfk_1` FOREIGN KEY (`cliente_id`) REFERENCES `clientes` (`id`),
  CONSTRAINT `facturacion_ibfk_2` FOREIGN KEY (`direccion_id`) REFERENCES `direcciones` (`id`),
  CONSTRAINT `facturacion_ibfk_3` FOREIGN KEY (`empresa_id`) REFERENCES `catempresas` (`id`),
  CONSTRAINT `facturacion_ibfk_4` FOREIGN KEY (`metodopago_id`) REFERENCES `pago_metodo` (`id`),
  CONSTRAINT `facturacion_ibfk_5` FOREIGN KEY (`condicionpago_id`) REFERENCES `pago_condicion` (`id`),
  CONSTRAINT `facturacion_ibfk_6` FOREIGN KEY (`estatus_id`) REFERENCES `fac_estatus` (`id`),
  CONSTRAINT `facturacion_ibfk_7` FOREIGN KEY (`user_id_reg`) REFERENCES `users` (`id`)
