INSERT INTO `facturas`.`blog` (`id`,`titulo`,`copete`,`cuerpo`,`usuario_id`,`created_at`,`updated_at`,`deleted_at`) VALUES (1, 'Acuerdo Comercial', 'Descripción del Acuerdo Comercial', '<h3><strong>El Acuerdo Comercial</strong></h3>\r\n\r\n<p>Es un documento que refleja un acuerdo entre la empresa y/o cliente y nuestra empresa<strong>&nbsp;JM Corporativo</strong>&nbsp;donde se establecen los porcentajes de comisi&oacute;n que se pactan para la realizaci&oacute;n de los trabajos solicitados, este es un documento suceptible de cambios en el transcurso de su vigencia por lo que que puede cambiar en cualquier momento por lo que cuando se realice algun cambio, todos los involucrados recibiran una notificaci&oacute;n por correo el&eacute;tronico.</p>\r\n\r\n<p><strong>Instrucciones</strong></p>\r\n\r\n<p>Seleccione y escriba los datos que el formulario solicita.</p>\r\n\r\n<p><strong>Socio Comercial: </strong>Seleccione el asociado comercial personal que recomienda al cliente.</p>\r\n\r\n<p>El presente acuerdo tiene que ser validado por dos tipos de usuario Supervisor y Gerente.</p>\r\n\r\n<p>Pero la .....</p>', 1, '2019-01-15 15:13:19', '2019-01-23 12:03:47', NULL);
